column3:
Өмүрбаяны
 1958-жылдын 28-февралында Ош шаарында туулган.
Жогорку билимдүү. 1979-жылы Кыргыз мамлекеттик университетин экономист адистиги боюнча бүтүргөн, 1998-жылы Кыргыз мамлекеттик университетинин Юридикалык факультетин аяктаган.
1979-1997-жылдары Ош облустук аткаруу комитетинде ар кандай кызматтарда иштеген.
1997-2006-жылдары  Кыргыз Республикасынын Мамлекеттик салык кызматынын  бөлүмдөрүндө иштеген.
2007-2008-жылдары  Кыргыз Республикасынын  Социалдык фондунун төрагасынын кеңешчиси, Социалдык фондунун Свердлов районунун башчысынын орунбасары;
2008-2010-жылдары Кыргыз Республикасынын Жогорку Кеңешинде консультант;
2010-жылы «Аялдар кенеши» коомдук бирикмесинин жана «Биримдик» демократиялык партиясынын төрайымы;
2010-жылдын октябрь айында «Ар-Намыс» саясий партиясынын тизмеси боюнча V чакырылыштагы Кыргыз Республикасынын Жогорку Кенешинин депутаты болуп шайланган. 2012-жылдын ноябрь айында Жогорку Кеңештин регламенти жана депутаттык этика боюнча комитетинин төрайымы болгон.
2015-жылдын 4-октябрында КСДП саясий партиясынын тизмеси боюнча VI чакырылыштагы Кыргыз Республикасынын Жогорку Кеңешинин депутаты болуп шайланган.
Үй бүлөлүү, эки балалуу.
Мамлекеттик кызматынын 3-класстагы мамлекеттик кеңешчиси;
Кыргыз Республикасынын мамлекеттик кызматынын отличниги;
Кыргыз Республикасынын финансы-экономикалык иштеринин отличниги;
Кыргыз Республикасынын Жогорку Кеңешинин Ардак грамотасы, КМШ ПААнын Ардак грамотасы менен сыйланган.
«КР мамлекеттик кызматынын эмгек сиңирген ишмери»
 «Акыйкат», «Мээримдүүлүк», «Датка айым» медалдарынын ээси.

Өмүрбаяны
 1956 жылы 9-майда Чүй облусуна караштуу  Панфилов районунун, Чолок-Арык айылында туулган.
1979-1984 жылдары  Москва шаарындагы Бүткүл союздук тамак-аш өнөр жай институтун аяктап, экономист кесибин алган.
-1995-1998 жылдары Бишкек  шаарындагы Кыргыз Мамлекеттик  Улуттук университетин аяктап “Юриспруденция”  адистигин алган.
-1975 -1977 жылдары   Мурманск шаарында,  Советтик армиянын  катарында кызмат өтөгөн,улук сержант  наамына ээ.
-1978-1981  жылдары   Панфилов районуна караштуу, Панфилов айылынын колхозунда  комсомол    уюмунун катчысы болуп   эмгектенип баштаган;
 -1982-1987 жылдары  Панфилов  районуна караштуу  Каинды даярдоо  конторасында  товаровед, директордун орун басары болуп эмгектенген;
1987-май айынан октябрь айына чейин  Панфилов райондук партиялык  комитетинин (райком партия) - уюштуруу бөлүмүндө инструктор болуп эмгектенген;
-1987-1990 жылдары  Панфилов райондук Чалдовар айылында  райондук керек-жарак союзунун -  Төрагасы кызматын аркалаган;
-1990-1995 жылдары Панфилов районуна караштуу Каинды даярдоо  канторасында –директорлук кызматта иштеген;
-1995-1998  жылдары  Бишкек шаарындагы Ала-Арча  базарынын «Ош базарында» -Генералдык  директор кызматын аркалаган;
-1998-2012 жылдары  ЖЧК «Артель О» фирмасында –директор  болуп эмгектенген;
- 2012-жылы   Кыргыз Республикасынын Жогорку Кенешинде  депутаттын жардамчысы болуп кызмат кылган;
- 2012-2015  жылдары Кыргыз Республикасынын   Өкмөтүнүн  алдындагы  Мамлекеттик Салык кызматынын  башкармалыгында  начальниктин  орун  басары  болуп иштеген.
2018- жылдын июнь айынан баштап «Кыргызстан» саясый партиясынын тизмеси боюнча VI чакырылыштагы  Кыргыз  Республикасынын  Жогорку  Кеңешинин  депутаты.
Үй-бүлөлүү , 4 баланын атасы

Өмүрбаяны
 Айнура Аскарова 1976-жылы 9-октябрда Чүй облусунун Чүй районун Кегети айылында туулган
1998-жылы Ж. Баласагын атындагы Кыргыз Улуттук университетинин журналистика бөлүмүн бүтүргөн, 2008-жылы  Мамлекеттик башкаруу академиясын (Магистратура) жана 2019-жылы И.Арабаев атындагы Кыргыз мамлекеттик университетинин "Политология" адистиги боюнча аспирантура бөлүмүн аяктаган.
Иш тажырыйбасы:

 1998–2003 — "Эркин-Тоо" газетасынын кабарчысы;
2003–2005 — "Замандаш" журналынын шеф-редактору;
2005–2006 — Кыргыз Республикасынын билим берүү жана илим министрлигинин басма сөз катчысы.
2006–2007 — Кыргыз Республикасынын Жогорку Кеңешинин Төрагасынын басма сөз катчысы;
2007–2011 — Бала багуу өргүүсүндө;
2009–2015 — "Замандаш" саясий кеңешинин мүчөсү жана маалымат бөлүмүнүн башчысы;
2011 — Кыргыз Республикасынын Жогорку Кеңешинин депутатынын консультанты;
2015 —"Кыргызстан" саясий партиясынын аялдар комитетинин куратору;
2016 —Кыргыз Республикасынын Жогорку Кеңешинин "Кыргызстан" фракциясынын эксперти;
2017–2018 — И.Арабаев атындагы Кыргыз мамлекеттик университетинин аймактык жана маданий изилдөөлөр кафедрасынын окутуучусу;
2017 – 2018 — Кыргыз Республикасынын Президентине караштуу мамлекеттик тил боюнча улуттук комиссиясынын кыргыз тили боюнча тартылган окутуучсу;
2018 – 2019 — Кыргыз Республикасынын Жогорку Кеңешинин "Кыргызстан" фракциясынын сектор башчысы;
2019 -  "Кыргызстан" партиясынын тизмеси боюнча VI чакырылыштагы Кыргыз Республикасынын Жогорку Кеңешинин депутаты.

Дополнительно:

2015–2017 — Өзгөчө кырдаалдар министрлигинин коомдук байкоочу кеңешинин мүчөсү;
2017–2018 — КТРКнын байкоочу кеңешинин мүчөсү.

Мамлекеттик кызматтын 1-класстагы мамлекеттик кеңешчиси.
Үй-бүлөлүк абалы: никеси бар.

Өмүрбаяны
 1978-жылы Ош облусуна караштуу Араван районунун Төө-Моюн айылында туулган.
Жогорку билимдүү. 2001-жылы Кыргыз-Өзбек университетинин “Финансы жана Кредит” факультетин аяктаган.
Эмгек жолун 2001-жылы жеке ишкер катары баштаган.
1996-2001-жылдары Ош облусундагы Кыргыз-Өзбек университетинин студентти;
2001-2008-жылдары жеке ишкер;
2008-2010-жылдары АК «Гаранттын» директору;
2010-2011-жылдары Кыргыз Республикасынын Жогорку Кеңешинин Төрагасынын жардамчысы болуп эмгектенген.
2011-жылы  24-июнунан тарта АК «Гаранттын» директору;
2011-жылдын 21-июлунан 23-сентябрына чейин Кыргыз Республикасынын Жогорку Кеңешинин Төрагасынын кеңешчиси болуп иштеген;
2011-2015-жылдары Кыргыз Республикасынын Жогорку Кеңешинин V-чакырылышынын депутаты;
2018-жылы 29-ноябрда ААК «Кыргызтелекомдун» төрагасынын кеңешчиси болуп дайындалган;
2018-жылдын 26-декабрынан бери Кыргыз Республикасынын Жогорку Кеңешинин VI-чакырылышынын депутаты.
Үй-бүлөлү, төрт баланын атасы.

Өмүрбаяны
 Гайпкулов Искандер Төрөбаевич 1966-жылдын 25-мартында Ош облусунун Араван районунун Жаңы-Арык айылында туулган.
Эмгек ишмердигин 1984-жылы Ош облусунун Араван райондук каржы бөлүмүнүн инспектору болуп баштаган.
1984-жылы Фрунзедеги финансы-экономикалык техникумун "финансист" адистиги боюнча бүтүргөн.
1996-жылы Алма-Ата шаарындагы Мамлекеттик башкаруу Академиясын "экономист" адистиги боюнча аяктаган.
1984-жылдан тартып 1986-жылга чейин СССРдин Куралдуу Күчтөрүндө кызмат өтөгөн.
 
1984-1986-жылдары - Араван райондук финансы бөлүмүндө мамлекеттик киреше боюнча инспектор;
1986-1990-жылдары - Ош облустук финансы башкармалыгында текшерүүчү-инспектор, текшерүүчү ага инспектор;
1990-1991-жылдары - Ош облусунун  Мамлекеттик салык инспекциясынын башкы мамлекеттик салык инспектору;
1991-1992-жылдары - Жалал-Абад облусунун Мамлекеттик салык инспекциясынын бөлүм башчысы;
1992-1993-жылдары - Ош шаарынын Мамлекеттик салык инспекциясынын башчысынын орун басары;
1993-1996-жылдары - Ош облусунун Араван районунун  Мамлекеттик салык инспекциясынын жетекчиси;
1996-1999-жылдары - Ош облусунун Мамлекеттик салык инспекциясынын жетекчиси;             
1999-жылдын август айынан тартып декабрь айына чейин Кыргыз Республикасынын Президентинин Аппаратынын жетекчисинин орун басары;
1999-жылдын декабрь айынан  2002-жылга чейин Баткен районунун мамлекеттик администрациясынын башчысы - Акими;
2002-2005-жылдары -  Кыргыз Республикасынын Президентинин алдындагы чет элдик инвестицияларды тартуу боюнча атайын өкүлчүлүктүн катчылыгы, “Инвестициялык төгөрөк стол” коомдук бирикмесинин эксперти;
2005-2007-жылдары - Кыргыз Республикасынын Жогорку Кенешинин III чакырылышынын депутаты;
2007-2010-жылдары - Кыргыз Республикасынын Эсептөө палатасынын төрагасы;
2011-2013-жылдары - "РСК Банк" ААКнын директорлор кеңешинин төрагасы;
2013-2015-жылдары - жеке ишкер;
2015-жылдын январь айынан тартып 2017-жылдын декабрь айына чейин - "Аймактык саясат институту" мамлекеттик эмес билим берүү мекемесинин Борбор Азия боюнча филиалынын Кыргыз Республикасындагы бөлүмүнүн директору;
2017-жылдын декабрь айынан тарта "Ата Мекен" фракциясынан Кыргыз Республикасынын Жогорку Кенешинин VI чакырылышынын депутаты.
 
1999-жылы Кыргыз Республикасынын Ардак Грамотасы, 2009-жылы  "Кыргыз Республикасынын эмгек сиңирген экономисти” ардак наамы менен сыйланган.
Кыргыз Республикасынын мамлекеттик кызматынын II класстагы мамлекеттик кеңешчиси. Биринчи даражадагы салык кызматынын кеңешчиси.
Аскердик наамы - подполковник.
Үй-бүлөлүү. 4 баланын атасы.

Өмүрбаяны
 1970-жылы Нарын областынын Ат-Башы районуна караштуу Ат- Башы айылында туулган.
Жогорку билимдүү. 1994-жылы Кыргыз мамлекеттик университетинин  Эсеп-коммерциялык факультетин, 2003-жылы Кыргыз улуттук университетинин Юридика факультетин бүтүргөн.
Эмгек жолун Ат-Башы районунун РайПОсунун улук бухгалтери кызматында баштаган.
1995-жылдын декабрь айынан июнь айына чейин Мамлекеттик салык инспекциясынын Октябрь районунда инспектор;
1995-2003-жылдары –Мамлекеттик салык инспекциясынын Биринчи май району боюнча башкармалыгында инспектору, сектор башчысы;
2003-2006-жылдары - Мамлекеттик салык инспекциясынын Ленин району боюнча башкармалыгынында  бөлүм башчы;
2006-2008-жылдары - Мамлекеттик салык инспекциясынын Свердлов району боюнча башкармалыгында бөлүм башчы;
2008-2010-жылдары - Кыргыз Республикасынын Экономиканы жөнгө салуу министрлигине караштуу Мамлекеттик инспекциясынын директору;
2010-2015-жылдары  V чакырылыштагы Кыргыз Республикасынын Жогорку Кеңешинин  депутаты болуп шайланган. 2010-2012-жылдары КР  Жогорку Кеңешинин Эл аралык иштер боюнча комитетинин төрагасы, 2013-2015-жылдары КР  Жогорку Кеңешинин Коргоо жана коопсуздук боюнча комитетинин төрагасы болгон.
2015-жылдын 4-октябрында “Кыргызстан” саясий партиясынын тизмеси боюнча VI чакырылыштагы Кыргыз Республикасынын Жогорку Кенешинин  депутаты болуп шайланган. 2015-жылдын ноябрь айынан 2016-жылдын октябрь айына чейин Эл аралык иштер, коргоо жана коопсуздук комитетинин төрагасы болгон.
2016-жылдын октябрь айынан тартып  "Кыргызстан" парламенттик фракциясынын лидери.
Үй-бүлөлүү, төрт баланын атасы.

Өмүрбаяны
 1965-жылдын 20-октябрында Ош облусунун Кызыл-Кыя шаарында туулган.
Жогорку билимдүү. 1990-жылы Д.Ф.Устинов атындагы Ленинград аскер-механикалык институтун “инженер-механик” адистиги боюнча бүтүргөн.
Эмгек жолун 1983-жылы Түштүк базада темир уста болуп баштаган.
1990-1991- жылдары - «Алай» машина куруучу заводдо мастер;
1991-1992- жылдары - механикалык өндүрүштү даярдоочу цехтин жетекчисинин орун басары;
1992-1993- жылдары цехтин жетекчиси;
1993-1996- жылдары «Маруф»кичи ишканасынын коммерциялык суроолор боюнча директордун орун басары;
1996-1999- жылдары Кызыл-Кыя машина куруучу заводунда (МАК) өндүрүш боюнча директордун орун басары;
1999-2008- жылдары Кызыл-Кыя машина куруучу заводунда (АТАК) өндүрүш боюнча директордун орун басары;
2008-2015-жылдары Кызыл-Кыя машина куруучу заводунун (АТАК) башкармалыгынын төрагасы;
2004–2015-жылдары КСДП партиясынын Кызыл-Кыя шаардык кеңешинин депутаты, төраганын орун басары;
2015-жылдын 4-октябрында КСДП саясый партиясынан VI чакырылыштагы Кыргыз Республикасынын  Жогорку Кеңешинин  депутаты болуп шайланган.
Үй-бүлөлүү, үч баланын атасы.

Өмүрбаяны
 1977-жылдын 9-сентябрында Ош облусунун, Ош шаарында туулган. Жогорку билимдүү. 1999-жылы Ош мамлекеттик университетин юриспруденция адистиги боюнча бүтүргөн.
Эмгек жолун 2000-жылы Ош областынын, Лейлек районунун ИИБ ЭККББнын ыкчам кызматкери болуп баштаган.
2001-2005- жылдары - Ош шаарынын ИИБ тергѳчүүсү;
2005-2007- жылдары - Кыргыз Республикасынын НКАнин Түштүк аймагы боюнча ТБнүн тергѳѳчүсү;
2007-2010 - жылдары  Ош областынын Кара-Суу райондук сотунунун судьясы;
2011-2014- жылдары - Кыргыз Республикасынын Судьяларын тандоо боюнча кеңешинин мүчѳсү;
2015-жылдын 4-октябрында «Ѳнүгүү-Прогресс»  саясый партиясынан VI чакырылыштагы Кыргыз Республикасынын  Жогорку Кеңешинин  депутаты болуп шайланган.
